    function simplifyGeometryOnce(coords, config) {
        if (!coords || coords.length < 3) return {
            coords: coords,
            removed: 0
        };
        const points = coords.slice(0, -2).map((_, i) => ({
            index: i + 1,
            angle: GeoUtils.findAngle(coords[i], coords[i + 1], coords[i + 2]),
            distStart: GeoUtils.getDistance(coords[i], coords[i + 1]),
            distEnd: GeoUtils.getDistance(coords[i + 1], coords[i + 2])
        }));
        const toRemove = new Set;
        for (let i = 0; i < points.length; i++) {
            const p = points[i];
            if (p.angle >= config.retaMin) {
                toRemove.add(p.index);
                continue;
            }
            if (p.distStart <= config.shortSegment) {
                toRemove.add(p.index);
                continue;
            }
            if (p.angle >= config.minAngle && p.distEnd <= config.shortSegment) {
                toRemove.add(p.index);
                i++;
                continue;
            }
            if (p.angle >= config.retaLon && p.distStart + p.distEnd <= config.twoShortSumLon) {
                toRemove.add(p.index);
                continue;
            }
            if (p.angle >= config.minAngle && p.distStart + p.distEnd <= config.twoShortSum) toRemove.add(p.index);
        }
        if (toRemove.size === 0) return {
            coords: coords,
            removed: 0
        };
        const newCoords = coords.filter((_, i) => i === 0 || i === coords.length - 1 ? true : !toRemove.has(i));
        return {
            coords: newCoords,
            removed: toRemove.size
        };
    }
    async function simplifySegments(config = CONFIG) {
        const selection = SDK.Editing.getSelection();
        if (!selection.ids || selection.ids.length === 0) return;
        let simplified = 0;
        let totalRemoved = 0;
        for (const segmentId of selection.ids) {
            const segment = SDK.DataModel.Segments.getById({
                segmentId: segmentId
            });
            if (!segment || !segment.geometry?.coordinates) continue;
            let coords = structuredClone(segment.geometry.coordinates);
            let removedInPass = 0;
            let removedTotalSegment = 0;
            let pass = 0;
            do {
                const result = simplifyGeometryOnce(coords, config);
                removedInPass = result.removed;
                coords = result.coords;
                removedTotalSegment += removedInPass;
                pass++;
            } while (removedInPass > 0 && coords.length >= 3 && pass < config.maxPasses);
            if (removedTotalSegment > 0 && coords.length >= 2) {
                const newGeometry = structuredClone(segment.geometry);
                newGeometry.coordinates = coords;
                SDK.DataModel.Segments.updateSegment({
                    segmentId: segment.id,
                    geometry: newGeometry
                });
                simplified++;
                totalRemoved += removedTotalSegment;
            }
        }
        const message = `WME RAPID KOI ROADS - Processados ${selection.ids.length} segmento(s), ` + `${simplified} simplificado(s), ${totalRemoved} ponto(s) removido(s)`;
        void 0;
        criarBadgeResultadoSimplificacao({
            processados: selection.ids.length,
            simplificados: simplified,
            pontosRemovidos: totalRemoved
        });
        return {
            success: true,
            message: message,
            processed: selection.ids.length,
            simplified: simplified,
            pointsRemoved: totalRemoved
        };
    }
