    function updatePositionDrag(dragHandle) {
        document.addEventListener("click", exibirBTN);
        document.addEventListener("mouseup", exibirBTN);
        let isDragging = false;
        let startX, startY;
        dragHandle.addEventListener("mousedown", event => {
            isDragging = true;
            startX = event.clientX - dragHandle.offsetLeft;
            startY = event.clientY - dragHandle.offsetTop;
            event.preventDefault();
        });
        document.addEventListener("mousemove", event => {
            if (!isDragging) return;
            const currentX = event.clientX - startX;
            const currentY = event.clientY - startY;
            dragHandle.style.left = `${currentX}px`;
            dragHandle.style.top = `${currentY}px`;
            const deslocamentoLat = -event.movementY * LAT_OFFSET_METERS;
            const deslocamentoLon = event.movementX * LON_OFFSET_METERS;
            ShiftSegmentNodes(deslocamentoLat, deslocamentoLon);
        });
        document.addEventListener("mouseup", () => {
            isDragging = false;
        });
    }
    function updatePositionClick(clickHandle) {
        const valorInput = document.getElementById("valorDeslocamento");
        const LAT_OFFSET_METERS = 9e-6;
        if (clickHandle.dataset.listenerAdicionado !== "true") {
            clickHandle.addEventListener("click", function(event) {
                const seta = event.target.closest(".seta");
                if (!seta) return;
                const direcao = seta.getAttribute("data-direcao");
                const valor = parseInt(valorInput.value, 10) || 1;
                const deslocamento = valor * LAT_OFFSET_METERS;
                seta.style.transform = "scale(0.9)";
                setTimeout(() => {
                    seta.style.transform = "";
                }, 150);
                let deslocamentoLat = 0;
                let deslocamentoLon = 0;
                switch (direcao) {
                  case "norte":
                    deslocamentoLat = deslocamento;
                    break;

                  case "nordeste":
                    deslocamentoLat = deslocamento;
                    deslocamentoLon = deslocamento;
                    break;

                  case "leste":
                    deslocamentoLon = deslocamento;
                    break;

                  case "sudeste":
                    deslocamentoLat = -deslocamento;
                    deslocamentoLon = deslocamento;
                    break;

                  case "sul":
                    deslocamentoLat = -deslocamento;
                    break;

                  case "sudoeste":
                    deslocamentoLat = -deslocamento;
                    deslocamentoLon = -deslocamento;
                    break;

                  case "oeste":
                    deslocamentoLon = -deslocamento;
                    break;

                  case "noroeste":
                    deslocamentoLat = deslocamento;
                    deslocamentoLon = -deslocamento;
                    break;
                }
                if (typeof ShiftSegmentNodes === "function") ShiftSegmentNodes(deslocamentoLat, deslocamentoLon); else void 0;
            });
            clickHandle.dataset.listenerAdicionado = "true";
        }
    }
    function ShiftSegmentNodes(latOffsetMeters, lonOffsetMeters) {
        const uniqueNodes = new Set;
        const selecao = SDK.Editing.getSelection();
        if (selecao.objectType !== "segment") return;
        segmentosSelecionados = selecao.ids.map(id => SDK.DataModel.Segments.getById({
            segmentId: id
        })).filter(Boolean);
        segmentosSelecionados.forEach(segmento => {
            const geom = segmento.geometry;
            if (!geom || geom.type !== "LineString") return;
            const newGeometry = structuredClone(geom);
            const len = newGeometry.coordinates.length;
            for (let i = 1; i < len - 1; i++) {
                newGeometry.coordinates[i][0] += lonOffsetMeters;
                newGeometry.coordinates[i][1] += latOffsetMeters;
            }
            SDK.DataModel.Segments.updateSegment({
                segmentId: segmento.id,
                geometry: newGeometry
            });
            let nodeStart = SDK.DataModel.Nodes.getById({
                nodeId: segmento.fromNodeId
            });
            let nodeEnd = SDK.DataModel.Nodes.getById({
                nodeId: segmento.toNodeId
            });
            if (nodeStart) uniqueNodes.add(nodeStart);
            if (nodeEnd) uniqueNodes.add(nodeEnd);
        });
        uniqueNodes.forEach(node => {
            if (!node?.id || !node?.geometry) return;
            let newNodeGeometry = structuredClone(node.geometry);
            newNodeGeometry.coordinates[0] += lonOffsetMeters;
            newNodeGeometry.coordinates[1] += latOffsetMeters;
            SDK.DataModel.Nodes.moveNode({
                geometry: newNodeGeometry,
                id: node.id
            });
        });
    }
