    function configImportExport() {
        const localStorageKeys = [ "WME_RAPID_KOY_ROADS_CONFIG", "WME_RAPID_KOY_ROADS_CONFIG_CorTextoRadioBranco", "WME_RAPID_KOY_ROADS_CONFIG_CorTextoRadioPreto", "WME_RAPID_KOY_ROADS_CONFIG_editPanelKoi", "WME_RAPID_KOY_ROADS_CONFIG_moverSegmentos", "WME_RAPID_KOY_ROADS_CONFIG_ocultarIcones", "WME_RAPID_KOY_ROADS_CONFIG_openSv", "WME_RAPID_KOY_ROADS_CONFIG_padrao" ];
        document.getElementById("fileInputRapidKoiRoads").addEventListener("change", event => {
            const file = event.target.files[0];
            if (!file) return;
            const reader = new FileReader;
            reader.onload = function(e) {
                try {
                    const dados = JSON.parse(e.target.result);
                    localStorageKeys.forEach(key => {
                        if (dados.hasOwnProperty(key)) {
                            const value = dados[key];
                            const valueToStore = typeof value === "object" ? JSON.stringify(value) : value;
                            localStorage.setItem(key, valueToStore);
                        }
                    });
                    window.location.replace(window.location.href);
                } catch (err) {
                    alert("Erro ao importar o backup: " + err.message);
                }
            };
            reader.readAsText(file);
        }, {
            once: true
        });
        document.getElementById("importarRapidKoiRoads").addEventListener("click", () => {
            document.getElementById("fileInputRapidKoiRoads").click();
        });
        document.getElementById("exportarRapidKoiRoads").addEventListener("click", () => {
            const dados = {};
            localStorageKeys.forEach(key => {
                const value = localStorage.getItem(key);
                try {
                    dados[key] = JSON.parse(value);
                } catch {
                    dados[key] = value;
                }
            });
            const blob = new Blob([ JSON.stringify(dados, null, 2) ], {
                type: "application/json"
            });
            const url = URL.createObjectURL(blob);
            const a = document.createElement("a");
            a.href = url;
            a.download = "BACKUP_WME_RAPID_KOI_ROADS.json";
            a.click();
            URL.revokeObjectURL(url);
        }, {
            once: true
        });
    }
